ts, and the winner of each round will get all the chips on the field at the same time</li></ol></section>\r\n                <section style=\"width:300px;margin-right:20px;\"><ol><br>\r\n                        <li>If only one player chooses to take a card in a round, that player will win the round.</li>\r\n                        <br>\r\n                        <li>If everyone busts , the last player to bust wins the round.</li>\r\n                        <br>\r\n                        <li>The first player to reach 21 points wins the round.</li>\r\n                        <br>\r\n                        <li>At the end of three rounds, the player with the most chips will win the game</li></ol></section></div></div>");
